(function (jsPDFAPI) {
    var fonts = [{
        'fileName': 'MinionPro-Regular-normal.ttf',
        'fontName': 'MinionPro-Regular',
        'fontStyle': 'normal',
        'value': ''
    }, {
        'fileName': 'ADDCN___-normal.ttf',
        'fontName': 'ADDCN___',
        'fontStyle': 'normal',
        'value': ''
    }];

    var callAddFont = function () {
        for (var i = 0; i < fonts.length; i++) {
            this.addFileToVFS(fonts[i].fileName, fonts[i].value);
            this.addFont(fonts[i].fileName, fonts[i].fontName, fonts[i].fontStyle);
        }
    };

    jsPDFAPI.events.push(['addFonts', callAddFont])
})(jsPDF.API);